import React from "react";
import  ReactDOM  from "react-dom";
import add from "./app";
import  {Sub,Div,Mult} from "./app";
// import "./index.html";

ReactDOM.render(<>
                 <ol>
                    <li><h1>Sum of numbers is {add(10,3)}</h1> </li>    
                    <li><h1>Subtraction of numbers is {Sub(56,9)}</h1> </li>    
                    <li><h1>Division of numbers is {Div(33,2)}</h1> </li>    
                    <li><h1></h1>Multiply of numbers is {Mult(33,2)} </li>    
                </ol>   
    </>
    ,document.getElementById("third")
);
